import * as React from 'react';
import { useEffect, useState } from "react";
import myApi from "../../Api";
import useInput from "../../Validator";
import "../../custom.css";
import { useNavigate } from "react-router-dom"  ;

function Main() {
  const navigate = useNavigate();
  const [opros, setOpros] = useState("");
  let FIO = useInput("", { isEmpty: true, FIO: false });
  let age = useInput("", { isEmpty: true, age: false });
  let email = useInput("", { isEmpty: true, isEmail: false });
  let phone = useInput("", { isEmpty: true, phone: false });
  let location = useInput("", { isEmpty: true, location: false });
  let formObject = {
    name: FIO.formValue,
    email: email.formValue,
    age: age.formValue,
    phone: phone.formValue,
    location: location.formValue,
    opros: opros,
  };


  const handleChange = (e) => {
    let { name, value } = e.target;

    console.log(opros);
    setOpros(value);
  };
  const handleSubmit = (evt) => {
    evt.preventDefault();
    window.location.reload();
    myApi.postUser(formObject);
    myApi.postEmail({
      email: email.formValue,
      text: `Здравствуйте, ваша заявка успешно принята принята! Ожидайте обратной связи`,
    });

  };
  return (

    <div>
      <Container maxWidth="md" style={{ marginTop: '20px' }}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Paper style={{ padding: 20 }}>
              <Typography variant="h5" gutterBottom>
                Оставьте заявку на контрактную службу
              </Typography>
              <form>
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={6}>
                    <TextField label="Имя" variant="outlined" fullWidth />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <TextField label="Фамилия" variant="outlined" fullWidth />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField label="Email" variant="outlined" fullWidth />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField label="Сообщение" variant="outlined" multiline rows={4} fullWidth />
                  </Grid>
                  <Grid item xs={12}>
                    <Button variant="contained" color="primary">
                      Отправить заявку
                    </Button>
                  </Grid>
                </Grid>
              </form>
            </Paper>
          </Grid>
          <Grid item xs={12}>
            <Paper style={{ padding: 20 }}>
              <Typography variant="h5" gutterBottom>
                Информационный блок
              </Typography>
              <Typography variant="body1">
                Здесь можно разместить информацию о контрактной службе, политике конфиденциальности, контактные данные и другую важную информацию.
              </Typography>
            </Paper>
          </Grid>
          <Grid item xs={12}>
            <Paper style={{ padding: 20 }}>
              <Typography variant="h5" gutterBottom>
                Контакты
              </Typography>
              <Typography variant="body1">
                Телефон: 8-800-555-35-35 <br />
                Email: info@example.com <br />
                Адрес: ул. Пушкина, дом Колотушкина
              </Typography>
            </Paper>
          </Grid>
        </Grid>
      </Container>
    </div>

  );
}

export default Main;
